package com.ram.home.general;

public class IntSwap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a = 16;
		int b = 8;
		
		System.out.println(a + " " + b);
		
		a = a + b;
		
		b = a - b;
		
		a = a - b;
		
		System.out.println(a + " " + b);
		
		a = 10;
		
		b = 5;
		
		System.out.println(a + " " + b);
		
		a = a * b;
		
		b = a/b;
		
		a = a/b;
		
		System.out.println(a + " " + b);

	}

}
